import React from "react";
import "./components.css";

class Result extends React.Component {
    constructor(props){
        super(props);
    }

    render(){
        // console.log(this.props);
      return(
        <div className="all-wrapper">
            <div className="result-wrapper">
                <p>{this.props.results}</p>
            </div>
        </div>
      )
    }
}  
export default Result;
